import { useEffect } from 'react';
const Places = ({ addToFollow, search }) => {
    useEffect(() => {
        AOS.init({ duration: 2000 });
    }, []);

    const filteredCards = search
        ? Cards.filter((card) =>
            card.name.toLowerCase().includes(search.toLowerCase())
        )
        : Cards;

    return (
        <div className="Places">
            {
                filteredCards.map((card) => (
                    <div className='Card' key={card.id}>
                        <div className="CardImageContainer">
                            <img src={card.img} alt="" className='MainImage' data-aos='fade-right' />
                            <div className="AdditionImages">
                                <img src={card.firstImg} alt="" data-aos='fade-up' className='AdditionImg' />
                                <img src={card.secondImg} alt="" data-aos='fade-up' className='AdditionImg' />
                                <img src={card.thirdImg} alt="" data-aos='fade-up' className='AdditionImg' />
                            </div>
                        </div>
                        <div className="CardTextContainer">
                            <h3 className='Name' data-aos='fade-left' >{card.name}</h3>
                            <div className="text" data-aos='fade-left' >


                                <p>{card.text}</p>
                                <h4> Локація: <span>{card.location}</span></h4>
                                <h4> Адреса: <span>{card.adress}</span></h4>
                                <h4> Ціна: <span>{card.price}грн</span></h4>
                                <h4> Час роботи: <span>{card.time}</span></h4>
                                <h4> Телефон: <span>{card.phone}</span></h4>
                                <a href={card.site}> Cайт: <span>{card.site}</span></a>
                                <button className='Follow' onClick={() => addToFollow(card)}>follow</button>
                            </div>
                        </div>


                    </div>
                )

                )
            }
        </div>
    )
}
